Happy belated birthday to ME! I had a TIME this weekend and just getting around to posting.

Feeling…Full…figuratively and literally 

Long post alert . And if there are any typos 🤷🏾‍♀️ I’m not fixing them. 

This Birthday weekend was AMAZING. I feel so grateful and blessed for the people on my life. I don’t have a lot of people in my circle but baaaaabyyyy the ones I have ….🥺

First of all my love , my ace my babe thank you for everything. You made this weekend so special for me . I love you so much. 

@koko_guerra Excuse me???? Flying into town to surprise little old me Blitzaroni!!!!! 

@ebonybliss__  Friend!!! You did a phenomenal job! They better watch out for Ebony Bliss because my table set up was 💅🏾
@dutchfitstylist can I even trust you anymore ?? Because you had me fooled . 

@zarreaa_ and @xo_us  thank y’all for making my day in school special and for my beautiful gift. 
Thank you everyone who spent time with me this weekend , called, texted or left me a message here . I appreciate you all!  Cheers!!

#birthday #birthdaybehavior🎉 #birthdaygirl

