I needed a week to be still and get myself together .  Now I’m back with the battery in my back.  God has never let me lose anything that was meant for me. This was just a step to the next level. I’m coming for EVERYTHING! I know only greatness will come from this . I’ve had hundreds of people reach out to me . Through this  Me and @dutchfitstylist have had so many people pray over us and our businesses and send good vibes . So I know the blessings are going to pour in. I appreciate each and every one of you from the bottom of my heart.  Even if you just shared my post…thank you🤍 

And those of you who have donated to me Thank you so much.  Y’all love to say “I know it’s not much but…” it is much more than you think. And I appreciate it so much ! 

@kiasterlinghair thank you so much 🤍
@madebyrodneyjon thank you so much🤍
@blinkingpretty__boutique thank you so much🤍
@bmytoy thank you so much🤍
@ebonybliss_ thank you so much🤍
@beholda_lady thank you so much🤍
@mora_morasalon thank you so much I will be coming to see you next week 
@alexismichelemua thank you so much🤍

